function clearGMVals() {
  var keys = GM_listValues();
  for (var i=0, key=null; key=keys[i]; i++) { GM_deleteValue(key); }
  window.location.reload(true);
}

function setGMVal(sVar, sVal) {
  if (GM_getValue(sVar) == null) {
    GM_setValue(sVar, sVal);
  } else {
    sVal = GM_getValue(sVar);
  } 
  return sVal;
}

